def getFirst(floor):
  if floor == 1:
    return 1
  elif floor == 2:
    return 2

  i = (floor - 2) / 2
  baseSum = getS(4, i, 2)

  i = (floor - 3) / 2
  otherSum = getS(4, i, 2)

  return 4 + baseSum + otherSum
  

def getA(a1, n, d):
  return a1 + (n - 1) * d

def getS(a1, n, d):
  return (n * (a1 + getA(a1, n, d))) / d

def F(f, n):
  if n == 1:
    return getFirst(f)

  if f == 1:
    return (n+1) * (n) / 2
  
  baseSum = 0
  if f % 2 == 0:
    i = (n - 1) / 2
    baseSum = getS(2, i, 2)
  else:
    i = n / 2
    baseSum = getS(1, i, 2)

  otherStart = getA(5, f / 2, 4)
  if f % 2 == 1:
    otherStart = otherStart + 1
  
  otherSum = 0
  if f % 2 == 0:
    i = n / 2
    otherSum = otherSum + getS(otherStart, i, 2)
  else:
    i = (n - 1) / 2
    otherSum = otherSum + getS(otherStart, i, 2)

  return baseSum + otherSum + getFirst(f)


